import React from "react";
import './nav.css';

function Nav() {
  return (
    <div>
      <ul className="home-ul">
        <li className="home-ll">
            <h1>Vehicle Home</h1>
        </li>
        <li className="home-ll">
            <h1>Add Vehicle</h1>
        </li>
        <li className="home-ll">
            <h1>Vehicle Details</h1>
        </li>
      </ul>
    </div>
  )
}

export default Nav
